import React from 'react'
import style from './a.module.css'
import results from '../../assets/results.png'

const HomeResults = () => {
  return (
    <div className={style.outerDiv}>

    <img src={results} alt="" className={style.results} />
    </div>
  )
}

export default HomeResults
